import Home from "./home";
import TripPlanner from "./trip-planner";

const routes = [
  { key: "home", path: "/", exact: true, Component: Home },
  { key: "trip-planner", path: "/trip-planner", Component: TripPlanner }
];

export { routes, Home, TripPlanner };
